Brittney Skye, Hannah Harper, Ariana Jollee, Chris Cannon, Lee Stone, Kris Slater, Trina Michaels, Kris Knight, Brooke Banner

Hannah Harper stars in this sordid tale of a young girl whose life is consumed with fear, betrayal and an insatiable lust. A story of a lying, cheating fiance, an over zealous security officer and those tiny hidden cameras that pry into everyone's naughty sex lives and exposes all their dirty little secrets for the world to see. The late night sexual encounters, the mind dizzying blowjobs, all captures by a perverted deviate who lives and breathes from behind an intruding camera lens, and for those whose private lives are mercilessly unveiled,... there is no way out of this twisted sexual nightmare.

